import Roboto from "../Resource/font/fonts";
import {
  SignInContainer,
  SignInInputAreaContainer,
  SignInInputArea,
} from "./AuthenticationStyleComponent";
const EccText = styled.h3`
  font-family: "roboto";
`;

const SignIn = () => {
  return (
    <SignInContainer>
      <EccLogo style={{ margin: "auto" }} />
      <Roboto />
      <EccText>asd</EccText>
      <SignInInputAreaContainer>
        <SignInInputArea />
        <SignInInputArea />
      </SignInInputAreaContainer>
    </SignInContainer>
  );
};

export default SignIn;
